import React, { Component } from 'react';
import Navgationbar from './Navbar';
import Footerfile from './Footerfile';
import Carouselset from './Carousel';
import Services from './Services';
class Home extends Component {
    render() {
        return (
            <React.Fragment>
                <Navgationbar />
                <br/>
                <Carouselset />
                <br/>
                <Services />
                <Footerfile />
            </React.Fragment>
        );
    }
}

export default Home;
